import React from 'react';
import { Box } from '@mui/material';

const HomeSideBar: React.FC = () => {
    return (
        <Box sx={{
            display: "flex",
            flexDirection: "column",
            height: "97vh",
            width: "20vw",
            borderTopLeftRadius: "40px",
            borderBottomLeftRadius: "40px",
            backgroundColor: "grey"
        }}>

        </Box>
    );
};

export default HomeSideBar;
